- input: "TEXT\x1CC00434159\x1C.TEXT\x1C\x1CF3XT\x1CNew Solutions Political Action
    Committee maintains its administrative functions in the office of its vendor,
    Applied Research Coordinates.  Applied Research Coordinates periodically assesses
    the allocable portion of all administrative expenses pertaining to the Committee
    including rent, telephone, copying, internet, and fax. Applied Research Coordinates
    bills the Committee for these expenses and is reimbursed by a Committee check.
    \ The Committee has no employees.  No in-kind contributions have been generated
    by unreimbursed administrative expenses paid on behalf of the Committee  by a
    third party nor by any unreimbursed goods or services provided to the Committee
    by a third party.\n"
